import React from "react";

const Nav = () => {
  return (
    <nav style={styles.container}>
      <ul style={styles.ul}>
        <li>News Feed</li>
        <li>Messages</li>
        <li>Watch</li>
      </ul>
    </nav>
  );
};

export default Nav;

const styles = {
  container: {
    position: "fixed",
    width: "10rem",
    backgroundColor: "#ccc",
    top: "4rem",
    left: "0",
    bottom: "0",
  },
  ul: {
    listStyle: "none",
    padding: "0",
  },
};
